INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '2', 'nl', 'Home', '<div style=\"-webkit-column-count: 2; /* Chrome, Safari, Opera */ -moz-column-count: 2; /* Firefox */ column-count: 2;\">\r\n	<p>On this site I will collect all the Inquisimunda documents I can find, as well as post my work on warbands, scenario\'s and terrain. The Inquisimunda rules are fan-made adoptations on Games Workshop\'s Necromunda.\r\n	</p>\r\n	<p>Many thanks go to Jeremy who hosts the Inquisimunda 1.0 files on <a href=\"http://empireofghosts.blogspot.nl/p/inquisimunda-resources.html\" target=\"_blank\">http://empireofghosts.blogspot.nl/p/inquisimunda-resources.html</a>, as well as to the community on <a href=\"https://yaktribe.org/community/forums/inquisimunda.41/\" target=\"_blank\">Yaktribe.org</a> who work on the Inquisimunda 2.0 rules.\r\n	</p>\r\n</div>', NULL, '2015-09-15 12:10:56', '2015-10-15 14:54:47', '6e5e0d68-9d8e-41d1-97db-98719824952f');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('4', '4', 'nl', 'The site is launched!', '<p>Well, we have launched the site! Still working on the content people  :)</p><p><img src=\"{asset:20:url}\"><br></p><p><br></p>', 'Evin', '2015-09-15 13:30:08', '2015-09-18 08:55:49', 'ffeebc0f-10a2-45d8-9ac1-476567fe2723');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('5', '5', 'nl', 'Black Chimera Down', '<p>An Imperial Guard chimera has broken down! Can you save the wounded driver?</p>', NULL, '2015-09-15 13:32:05', '2015-09-21 20:17:56', '3fa68daa-c201-4c8e-a9f9-a5c6b450c4c5');
