INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('72', '72', 'nl', 'Pics from the Ducosim convention', '<p>Last saturday was a blast! Together with Manoah, Rik and Johan I hosted a demo of Inquisimunda at the Ducosim convention in Amersfoort, the Netherlands. We met a lot of old friends, and a lot of people took a look at our board! At least one person was very interested in playing the game as well, and by chance he lives about 10km for my local gaming place. Here are some pictures taken by Johan and Manoah.</p><p><img src=\"{asset:82:url}\"></p><p><img src=\"{asset:83:url}\"></p><p><img src=\"{asset:84:url}\"></p><p><img src=\"{asset:85:url}\"></p><p><img src=\"{asset:64:url}\"></p><p><img src=\"{asset:65:url}\"></p><p><img src=\"{asset:88:url}\"></p><p><img src=\"{asset:89:url}\"></p><p><img src=\"{asset:66:url}\"></p><p><img src=\"{asset:91:url}\"></p><p><img src=\"{asset:92:url}\"></p><p><img src=\"{asset:93:url}\"></p><p><img src=\"{asset:94:url}\"></p><p><img src=\"{asset:95:url}\"></p><p><img src=\"{asset:73:url}\"></p><p><img src=\"{asset:74:url}\"></p><p><img src=\"{asset:75:url}\"></p><p><img src=\"{asset:67:url}\"></p><p><img src=\"{asset:68:url}\"></p><p><img src=\"{asset:69:url}\"></p><p><img src=\"{asset:79:url}\"></p><p><img src=\"{asset:70:url}\"></p><p><img src=\"{asset:71:url}\"><br></p>', 'Evin', '2015-09-21 11:33:40', '2015-09-21 19:45:18', '12a42cc3-0834-400d-a6da-3c7ea434216c');
