INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('124', '124', 'nl', 'About', '<p>On this site I will collect all the Inquisimunda documents I can find, as well as post my work on warbands, scenario\'s and terrain. The Inquisimunda rules are fan-made adoptations on Games Workshop\'s Necromunda.</p><p>Many thanks go to Jeremy who hosts the Inquisimunda 1.0 files on <a href=\"http://empireofghosts.blogspot.nl/p/inquisimunda-resources.html\" target=\"_blank\">http://empireofghosts.blogspot.nl/p/inquisimunda-resources.html</a>, as well as to the community on <a href=\"https://yaktribe.org/community/forums/inquisimunda.41/\" target=\"_blank\">Yaktribe.org</a> who work on the Inquisimunda 2.0 rules.</p>', NULL, '2015-09-22 13:36:59', '2015-09-22 14:15:47', '66f2de19-6861-41e8-b9e1-0a975067af0d');
