INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('127', '127', 'nl', 'Scenario-The-Heretek', NULL, NULL, '2015-09-29 14:22:02', '2015-09-29 14:22:02', '1bf9d2bc-75dc-4035-8dbb-1dd5cf3b6bdf');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('128', '128', 'nl', 'The Heretek', '<p><i>Hereteks are fallen tech-priest who no longer adhere to the teachings of the Cult Mechanicus, instead pursuing dark technologies. One such Heretek has settled in an old abandoned Manufactorum, gathering who knows what foul technology and knowledge. Your warband plans on striking the Manufactorum and killing the Heretek. However, initial reconnaissance of the area shows the Heretek is accompanied by some of his servitors.</i></p>', NULL, '2015-09-29 14:22:08', '2015-09-29 14:22:08', 'f3f90495-65ca-44ea-b94e-6744f9672553');
