INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('135', '135', 'nl', 'Scenario-Gang-Fight', NULL, NULL, '2015-10-11 10:24:27', '2015-10-11 10:24:27', '9c25e1c2-588f-4380-a88a-acca5f7a58ec');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('136', '136', 'nl', 'Gang Fight', '<p><i>Gangs run the risk of encountering rivals as they explore the ruined Underhive landscape. Not all encounters end in violence. Sometimes two gangs meet and, finding no good reason to fight, go their own way. Other encounters end in bloody fire-fights, with neither side prepared to give way. Ultimately, every gang must be prepared to defend itself, to protect friends and family in the wastes, or simply maintain the respect of its trading contracts and rivals.</i><br></p><p>This is the original Gang Fight scenario from the Necromunda 2nd edition book.</p>', NULL, '2015-10-11 10:25:13', '2015-10-11 10:25:13', 'e262e225-6ffe-4361-9ff6-e5dfe0c763bb');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('137', '137', 'nl', 'Scenario-Scavengers', NULL, NULL, '2015-10-13 13:26:02', '2015-10-13 13:26:02', 'ad0df359-60de-48bc-8f3e-af795192379f');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('138', '138', 'nl', 'Scavengers', '<p><i>The deep Underhive is a maze of ancient and abandoned ruins, concealed entrances and long forgotten domes. Sometimes these contain priceless archeotech, gems, precious mutant fungi and other valuable items which can be scavenged from the depths. Treasure hunting is not without risk though, and those isolated places can be home to ferocious mutant creatures.</i><br></p><p>This is the original Gang Fight scenario from the Necromunda 2nd edition book.</p>', NULL, '2015-10-13 13:26:06', '2015-10-13 13:26:06', '80a2a557-aab1-4465-83ad-7c941ca705e8');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('139', '139', 'nl', 'Scenario-The-Safehouse', NULL, NULL, '2015-10-15 15:02:18', '2015-10-15 15:02:18', 'fe959c2f-bc84-4ca5-9b16-1f916f99d241');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_poster`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('140', '140', 'nl', 'The Safe House', '<p><i>Life is dangerous in the 41th millennium, and many organisation maintain safe houses for their agents. These can be ornate mansions, fit for imperial dignitaries, or little more than slums hidden away in some dark neighbourhood. Most safe houses are guarded secrets, for what is a safe house which is known to your enemies?</i></p>', NULL, '2015-10-15 15:02:26', '2015-10-15 15:02:26', '024c9a46-559b-450b-852e-afb5303b385a');



DROP TABLE IF EXISTS `craft_deprecationerrors`;


--
-- Schema for table `craft_deprecationerrors`
--
CREATE TABLE `craft_deprecationerrors` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `key` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `fingerprint` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `lastOccurrence` datetime NOT NULL,
  `file` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `line` smallint(6) unsigned NOT NULL,
  `class` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `method` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `template` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `templateLine` smallint(6) unsigned DEFAULT NULL,
  `message` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `traces` text COLLATE utf8_unicode_ci,
  `dateCreated` datetime NOT NULL,
  `dateUpdated` datetime NOT NULL,
  `uid` char(36) COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `craft_deprecationerrors_key_fingerprint_unq_idx` (`key`,`fingerprint`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

DROP TABLE IF EXISTS `craft_elements`;


--
-- Schema for table `craft_elements`
--
CREATE TABLE `craft_elements` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `enabled` tinyint(1) unsigned NOT NULL DEFAULT '1',
